import React from 'react';
import './App.css';
import { Route } from 'react-router-dom';
import Homepage from './pages/homepage/hoempage.component';

const hatsPage = () => (
  <div>
    <h1>HATS APGE</h1>
  </div>
);

function App() {
  return (
    <div>
      <Route exact path='/' component = {HomePage} />
      <Route exact path='/hats' component = {HatsPage} />
    </div>
  );
}

export default App;
